import React from "react";

function App() {
  return (
    <div className="App">

      <main className="main">
        <p className="main-content">Hello World</p>
      </main>
      <footer className="footer">
        <p className="footer-content">Hello World</p>
      </footer>
    </div>
  );
}

export default App;
